import React from 'react';
import featured_banners from '../data/featured-banners.json';


export const Slider = () => {

    const array = Object.entries(featured_banners);
    const imagenes= array[7][1];

    const urlImagenes = imagenes.map(item =>{
        //console.log(item);
        return item.data.main_image
    })

    console.log(urlImagenes);


    return (
    <>
        <div>
            {
                urlImagenes.map( img => (
                    <img  src={img.url} alt="carrito"/>
                ))

            }
        </div>
    </>
  )
}
